import React, {memo} from 'react';
import styled from 'styled-components';

const WeeklyBestContainer = styled.div`
    text-align: center;
    margin: 0 auto;
    background-color: #ff05;
    width:100%;

    .mainTitle{
        margin-top:96px;
        font-size:42px;
        font-weight: 700;
    }

    .menuWrap{
        margin-top:70px;
        display: flex;
        justify-content: center;

        .link{
            margin-right:40px;

            &:last-child{
                margin-right:0;
            }

            a{
                font-size:20px;
            }
        }
    }
`;

const WeeklyBest = memo(() => {
  return (
    <WeeklyBestContainer>
      <h1 className='mainTitle'>위클리 베스트</h1>
      <ul className='menuWrap'>
        <li className='link'><a href='#'>우먼</a></li>
        <li className='link'><a href='#'>맨</a></li>
        <li className='link'><a href='#'>키즈</a></li>
        <li className='link'><a href='#'>파자마</a></li>
      </ul>
      <div className='itemWrap'>
        <ul>
          <li>
            <div className='imgWrap'></div>
            <span><a href='#'>[리사이클] 베이직 퍼플리스 집업_SPFZD4TU01</a></span>
          </li>
        </ul>
      </div>
    </WeeklyBestContainer>
  );
});

export default WeeklyBest;
